import React from "react";
import SearchForm from "./SearchForm"; 

function Navbar() {
    return (
        <navbar>

            <h1 id="navHeader">BANK OF FLATIRON</h1>
            <form id="search-form">
            <input type="text" placeholder="Search Transaction" id="search-input"/>
            <button>Search</button>
            </form> 
        </navbar>
    )
}

export default Navbar
